VALUES ('4026813000170', 'Melange Asiatique Surgelé', 'LÉGUMES CHINOIS surgelé-vegan,sansgluten Ingrédicnts : carottes, choux-fleurs, poireaux, champignons, germes d\'haricots (10 ré), oignons, haricots verts, poivrons rouges et verts 100 % issus de l\'agricu!ture biologique (en pourcentages de poids variables). Préparation chauffez 2 cuillères d\'huile végétale dans une poêle. Ajoutezla czantité requise de légumes chinois surgelé. Laissez frire pendant 6 à 8 minutes, sur feu moyen, Mélangez occasionnellement.fugechauffezl cuillère d\'huilevégétale.Versezles lés€:mes chinois surgelé et laissez cuire à haute température pour environ 6 à 8 minutes ce que les légumes deviennent croquants et prêts. Conservation : au réfrigérateur (+2 00+4 oc) : 1 jour; (-18 OC) : voir la dale d\'expiration. i Repas recongeler le produit une fois décongelé !', 'https://static.openfoodfacts.org/images/products/402/681/300/0170/front_fr.4.400.jpg', '0.3', '0.1', '3.4', '3', '2.6', '2', '0.1', '0.0393700787401575', '', '1');

