INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('4028491403038', 'Fit4life', '80 % flocons (avoine, orge, blé grillé (flocons de blé, huile tournesol) ; seigle, mais (gruau de mais, sucre, sel, extrait de malt d\'orge)) ; 18 % mix raisins et fruits à coqu (raisins, noisettes, amandes) ; flocons de noix de coco. Peut contenir des traces de noix, d\'autres fruits à coques, d lait, soja. A conserver à une température inférieure à 260C. ES Muesli con Frutos secos y Pasas - Ingredientes: 80 % copos (avena, cebada, trigo tostado (copos de trigo aceite de girasol); centeno, maiz (sémola de maiz, azücar, sal, extracto de malta de cebada)); 18 % mezcla de pasa. y frutos secos (pasas, avellanas, almendras); copos de coco. Puede contener cacahuetes y otros frutos de céscara leche, soja. Conservar a una temperatura maxima de 260C. PT Muesli com nozes & uvas - Ingredientes: 80% flocos (aveia, cevada, trigo tostado (flocos de trigo, éleo de girassol), centeio, milho (grâos de milho, açücar, sal, extrato de malte de cevada)); 18% mistura de uvas passas e frutos de casca rija (uvas passas, avelâs, amêndoas); flocos de coco. Pode conter amendoins, outros frutos, leite, soja. Conservar em temperatura maxima de 260C. IT Muesli alle noci e all\'uva - Ingredienti: 80% fiocchi (avena, orzo, grano tostato (fiocchi di grano, olio di girasole); segale, granturco (semolino di granturco, zucchero, sale, estratto di malto d\'orzo)); 18% mix di uvetta e frutta a guscio (uvetta, nocciole, mandorle); scaglie di cocco. Può contenere tracce di arachidi, altra frutta a guscio, latte, soia. Conservare a temperatura ambiente (max. 260C). ? Inrtradion«er: 80% flinaor (havre. korn. rostatvete (veteflingor, solrosolja);', 'https://static.openfoodfacts.org/images/products/402/849/140/3038/front_fr.4.400.jpg', '6.3', '1.8', '61', '11', '8.8', '9.1', '0.6', '0.236220472440945', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('4028491405001', 'Milk Chocolate', 'Chocolat au lait avec édulcorant, sans sucres ajoutés Ingrédients: édulcorant (maltitol) ; beurre de cacao, lait en poudre (16 %), pâte de cacao, émulsifiant: lécithine de tournesol; arôme naturel de vanille. Teneur en cacao 32 % minimum. Une consommation excessive peut avoir des effets laxatifs. Peut contenir des traces de fruits à coque, sésame et soya. Contient les sucres naturellement présents. A conserver dans un endroit frais et sec, à distance d\'odeurs fortes. Température optimale de conservation: 18 C-20 °C.', '', '34', '21', '', '6', '', '', '0.1', '0.0393700787401575', '', '1');

